            Assert.True(result.IsTruncated);

            Assert.Equal("STANDARD", result.Items[1].StorageClass);

            Assert.Equal("100000/800x600.jpeg", result.Items[0].Key);
            Assert.Equal("100001/800x600.jpeg", result.Items[1].Key);
